    fgnum2 = PCLookUp.DataLookup("WallMWebbingLength", "fgnum_addition", Inputs.cmb_webbinglength.Value);
    Inputs.var_fgnum.Value = fgnum1 + fgnum2;
  }
  if (Inputs.var_weblengthfgnumaddition.Value != "TRUE") {
    Inputs.var_fgnum.Value = fgnum1;
  }

	/*FG description and number String generation*/
	Inputs.var_fgdesc.Value = "";
	Inputs.var_fgvalidity.Value = "";

	/* Determines if an alternate description string is required */
	string altdescrqd = "";
	altdescrqd = PCLookUp.DataLookup("WallMCassetteRange", "fg_desc_type", Inputs.cmb_cassetteselection.Value);

	if (altdescrqd == "") {
		Inputs.var_fgdesc.Value = PCLookUp.DataLookup("TENUK_FG_MasterTable", "fg_desc", Inputs.var_fgnum.Value);
	}

	if (altdescrqd != "") {
		Inputs.var_fgdesc.Value = PCLookUp.DataLookup("TENUK_FG_MasterTable", altdescrqd, Inputs.var_fgnum.Value);
	}

	if (Inputs.var_fgnum.Value == "") {Inputs.var_fgvalidity.Value = "** ERROR ** No Finished Goods number found.";}
	if ((Inputs.var_fgdesc.Value == "") && (Inputs.var_fgnum.Value != "")) {Inputs.var_fgvalidity.Value = "** ERROR ** The Finished Goods number has no TENUK_FG_MasterTable record.";}
	if ((Inputs.var_fgdesc.Value != "") && (Inputs.var_fgnum.Value != "")) {Inputs.var_fgvalidity.Value = "OK";}

	/* Set standard Warranty Code */
	string warranty = "";
	warranty = PCLookUp.DataLookup("TENUK_FG_MasterTable", "std_warranty", Inputs.var_fgnum.Value);
	if (warranty == "") {Inputs.chr_warranty.Value = "2YR";}
	if (warranty != "") {Inputs.chr_warranty.Value = warranty;}


	/* *************************************************************************** */

	/*BOM Part Verification */

	Inputs.var_bomvalidity.Value = "OK";
	if (!Inputs.chk_partverification.Value) {Inputs.var_bomstatus.Value = "** WARNING ** Bom verification is switched OFF.";}

	UDMethods.VerifyPart(Inputs.var_bodypartnum.Value, Inputs.var_ver1.Value);
	UDMethods.VerifyPart(Inputs.var_cappartnum.Value, Inputs.var_ver2.Value);
	UDMethods.VerifyPart(Inputs.var_fixingkitbompart.Value, Inputs.var_ver3.Value);
	UDMethods.VerifyPart(Inputs.var_fixpartnum.Value, Inputs.var_ver4.Value);
	UDMethods.VerifyPart(Inputs.var_cassettepartnum.Value, Inputs.var_ver5.Value);
	UDMethods.VerifyPart(Inputs.var_wedgepartnum.Value, Inputs.var_ver6.Value);
	UDMethods.VerifyPart(Inputs.var_webpartnum.Value, Inputs.var_ver7.Value);
	UDMethods.VerifyPart(Inputs.var_tapeendpartnum.Value, Inputs.var_ver8.Value);
	UDMethods.VerifyPart(Inputs.var_topcappartnum.Value, Inputs.var_ver9.Value);
	UDMethods.VerifyPart(Inputs.var_wallclippartnum.Value, Inputs.var_ver10.Value);
	UDMethods.VerifyPart(Inputs.var_addpart1.Value, Inputs.var_ver11.Value);
	UDMethods.VerifyPart(Inputs.var_addpart2.Value, Inputs.var_ver12.Value);
	UDMethods.VerifyPart(Inputs.var_addpart3.Value, Inputs.var_ver13.Value);
	UDMethods.VerifyPart(Inputs.var_alarmpartnum.Value, Inputs.var_ver14.Value);
	UDMethods.VerifyPart(Inputs.var_screwpart1.Value, Inputs.var_ver15.Value);
	UDMethods.VerifyPart(Inputs.var_addpackpart.Value, Inputs.var_ver16.Value);
	UDMethods.VerifyPart(Inputs.var_addpart1bom.Value, Inputs.var_ver17.Value);

	/* ************************************************************************************************************************************************* */

	/*Smart Code string generation */

	/* Calculation of OrderDtl_ProdCode based on webbing variant selected */
	/* Standard Webbing Variants */
	if ((Inputs.cmb_webvar.Value == "Standard") || (Inputs.cmb_webvar.Value == "")) {
		prodgroup = PCLookUp.DataLookup("ProductGroup", "group_code", Inputs.var_productgroup.Value);
		coretype = PCLookUp.DataLookup("SumSalesCat", "code", Inputs.var_coresolution.Value);

		/* Smart String Segment 5 Cassette Type Ref */
		weblength1 = Inputs.chr_webbingtype.Value;
	}

	/* Non-Standard Webbing Variants */
	if (Inputs.cmb_webvar.Value != "Standard") {
		/* Not Custom Webbing */
		if (!Inputs.chk_customwebbing.Value) {
			prodgroup = PCLookUp.DataLookup("WebbingVariants", "std_prodgroup", Inputs.cmb_webvar.Value);
			coretype = PCLookUp.DataLookup("WebbingVariants", "std_salecat", Inputs.cmb_webvar.Value);
		}
		if (Inputs.chk_customwebbing.Value) {
			prodgroup = PCLookUp.DataLookup("WebbingVariants", "custom_prodgroup", Inputs.cmb_webvar.Value);
			coretype = PCLookUp.DataLookup("WebbingVariants", "custom_salecat", Inputs.cmb_webvar.Value);
		}

		/* Smart String Segment 5 Cassette Type Ref */
		if (Inputs.chr_webbingtype.Value == "STD") {
			weblength1 = PCLookUp.DataLookup("WebbingVariants", "STD_smartref", Inputs.cmb_webvar.Value);
		}

		if (Inputs.chr_webbingtype.Value == "MAX") {
			weblength1 = PCLookUp.DataLookup("WebbingVariants", "MAX_smartref", Inputs.cmb_webvar.Value);
		}

		if (Inputs.chr_webbingtype.Value == "WDE") {
			weblength1 = PCLookUp.DataLookup("WebbingVariants", "WDE_smartref", Inputs.cmb_webvar.Value);
		}

		if (Inputs.chr_webbingtype.Value == "RCV") {
			weblength1 = PCLookUp.DataLookup("WebbingVariants", "RCV_smartref", Inputs.cmb_webvar.Value);
		}
	}

	if (Inputs.chr_webbingtype.Value == "") {weblength1 = "X";}

	/* Cassette ID */
	string smartcassid = "";
	if (Inputs.var_smartcassid.Value != "") {smartcassid = Inputs.var_smartcassid.Value;}
	if (Inputs.var_smartcassid.Value == "") {smartcassid = "";}

	if (Inputs.var_smartcodetapeend.Value != "") {tapeend = Inputs.var_smartcodetapeend.Value;}
	if (Inputs.var_smartcodetapeend.Value == "") {tapeend  = "X";}

	if (Inputs.cmb_webbingfinish.Value != "") {webcol = Inputs.cmb_webbingfinish.Value.Entry(1,'-');}
	if (Inputs.cmb_webbingfinish.Value == "") {webcol = "X";}

	if (Inputs.cmb_capfinish.Value != "") {capsmart = Inputs.var_capsuffix.Value;}
	if (Inputs.cmb_capfinish.Value == "") {capsmart = "X";}
	if (Inputs.cmb_capfinish.Value == "No Caps") {capsmart = "X";}

	Inputs.var_smartfg.Value = fgnum1 + fgnum2;

	string sumsalescat = "";
	if (Inputs.cmb_sumsalescat.Value == "Core") {sumsalescat = "COR";}
	if (Inputs.cmb_sumsalescat.Value == "Solution") {sumsalescat = "SOL";}

	/* WallClip */
	string wallclipcode = "";
	if (Inputs.var_smartwallclip.Value != "") {wallclipcode = Inputs.var_smartwallclip.Value;}
	if (Inputs.var_smartwallclip.Value == "") {wallclipcode = "X";}

	/* Fixing Kit */
	string fixkitcode = "";
	if (Inputs.var_smartfixkit.Value != "") {fixkitcode = Inputs.var_smartfixkit.Value;}
	if (Inputs.var_smartfixkit.Value == "") {fixkitcode = "X";}

	/* Webbing Length */
	string smartweblength = "";
	string smartweblength1 = "";
	if (Inputs.var_iscustomlength.Value == "TRUE") {String.Format("{0:0.00}",Inputs.dec_customweblength.Value);}
	if (Inputs.var_iscustomlength.Value != "TRUE") {smartweblength1 = Inputs.cmb_webbinglength.Value;}
	if (Inputs.var_webpartnum.Value == "") {smartweblength1 = "";}
	smartweblength = smartcassid + weblength1 + smartweblength1;

	/* TopCap Label */
	string topcapcode = "";
	if (Inputs.var_topcappartnum.Value != "") {topcapcode = Inputs.var_topcappartnum.Value.Entry(1,'-');}
	if ((Inputs.var_topcappartnum.Value == "") && (Inputs.var_padprintsuffix.Value != "")) {topcapcode = Inputs.var_padprintsuffix.Value;}

	if (Inputs.var_padprintsuffix.Value == "") {
		if ((Inputs.var_topcappartnum.Value == "") || (Inputs.cmb_labelselect.Value == "") || (Inputs.chk_nolabel.Value)) {topcapcode = "X";}
	}

	Inputs.var_smartstring.Value = Inputs.var_fgnum.Value + "|"  + fixkitcode + "|" + capsmart + "|" + Inputs.var_bodycolour.Value + "|" + smartweblength + "|" + webcol + "|" + tapeend + "|"  + wallclipcode + "|" + "X" + "|" + "X" + "|" + "X" + "|" + topcapcode;

	Inputs.var_smart1.Value = coretype + "-" + prodgroup;
	if (Inputs.var_smart1.Value == "-") {Inputs.var_smart1.Value = "COR-TBR";}
	Inputs.var_sku.Value = Inputs.var_fgnum.Value + "+"  + fixkitcode +  capsmart + Inputs.var_bodycolour.Value + smartweblength + webcol + tapeend + wallclipcode + "X" + "X" + "X" + topcapcode;
	Inputs.var_smart3.Value = Inputs.var_sectorcode.Value;


	/* ************************************************************************************** */

	/* Cassette Sub Assembly Smart ID */
	Inputs.var_casssmart.Value = "";
	if (Inputs.var_casfgnum.Value != "") {Inputs.var_casssmart.Value = Inputs.var_casfgnum.Value + "+" + "X" + "X" + "X" + smartweblength + webcol + tapeend + "X" + "X" + "X" + "X" + "X";}
	if (Inputs.var_casfgnum.Value == "") {Inputs.var_casssmart.Value = "";}

	/* ************************************************************* */
	decimal qtyonhandsub = 0;
	decimal demandqtysub = 0;
	decimal availqtysub = 0;
	bool fromstocksub = false;

	if (Mode != "Quote") {

		/* Determine the sub-assy mode to operate in */
		if (Inputs.chk_makedirect.Value) {Inputs.var_subcassstock.Value = false;}

		if (!Inputs.chk_makedirect.Value) {
			string subassystockmodelookup = "";
			subassystockmodelookup = PCLookUp.DataLookup("Assembly_Stocking_Mode", "mode", "subassy");
			/* Calculate the available qty for the cassette Sub Assembly */

			bool partrecordexistssub = false;
			string partrecordtypesub = "";
			Inputs.var_subcassstock.Value = false;

			string partTypeCode = "";
			bool available_part = UDMethods.GetPartTypeCode(Context.CompanyID,Inputs.var_casssmart.Value, out partTypeCode);
			if (available_part) {
				partrecordexistssub = true;          
				partrecordtypesub = partTypeCode;
			}

			if (partrecordexistssub) {

				/* Search for a cass sub assy part record and calculate the available qty's */
				available_part = UDMethods.GetPartQty(Context.CompanyID,Inputs.var_casssmart.Value, out qtyonhandsub, out demandqtysub);

				/* Sub-Assy will always be make direct */
				if (subassystockmodelookup == "NONE") {
					Inputs.var_subcassstock.Value = false;
				}

				/* only take subassy cassettes if the available qty fulfills the full demand */
				if (subassystockmodelookup == "FULL") {
					availqtysub = qtyonhandsub - demandqtysub;
					if (availqtysub < Inputs.dec_soqty.Value) {fromstocksub = false;}
					if (availqtysub == Inputs.dec_soqty.Value) {fromstocksub = true;}
					if (availqtysub > Inputs.dec_soqty.Value) {fromstocksub = true;}
					if ((partrecordexistssub) && (fromstocksub)) {Inputs.var_subcassstock.Value = true;}
					if ((partrecordexistssub) && (!fromstocksub)) {Inputs.var_subcassstock.Value = false;}
					if (!partrecordexistssub) {Inputs.var_subcassstock.Value = false;}
				}

				/* will take subassy cassettes if any available onhand balance regardless if it fulfills demand (MRP job will be created to satisfy balance) */
				if (subassystockmodelookup == "ANY") {
					availqtysub = qtyonhandsub - demandqtysub;
					if (availqtysub >= 1) {fromstocksub = true;}
					if (availqtysub == Inputs.dec_soqty.Value) {fromstocksub = true;}
					if (availqtysub > Inputs.dec_soqty.Value) {fromstocksub = true;}
					if ((partrecordexistssub) && (fromstocksub)) {Inputs.var_subcassstock.Value = true;}
					if (!partrecordexistssub) {Inputs.var_subcassstock.Value = false;}
				}
			}
		}
	}
	/* *********************************************** */

	/* Update the BOM structure based on the Cassette sub assy calculation */
	if (Inputs.var_subcassstock.Value) {
		Inputs.var_subcasspart.Value = Inputs.var_casssmart.Value;
		Inputs.var_subcasspart.Invisible = false;
		Inputs.var_casstkavail.Invisible = false;
		Inputs.var_cassettepartnum.Invisible = true;
		Inputs.var_cassetteqty.Invisible = true;
		Inputs.var_wedgepartnum.Invisible = true;
		Inputs.var_wedgeqty.Invisible = true;
		Inputs.var_webpartnum.Invisible = true;
		Inputs.var_webqty.Invisible = true;
		Inputs.var_tapeendpartnum.Invisible = true;
		Inputs.var_tapeendqty.Invisible = true;
	}

	if (!Inputs.var_subcassstock.Value) {
		Inputs.var_subcasspart.Value = "";
		Inputs.var_subcasspart.Value = Inputs.var_casssmart.Value;
		Inputs.var_subcasspart.Invisible = true;
		Inputs.var_casstkavail.Invisible = true;
		Inputs.var_cassettepartnum.Invisible = false;
		Inputs.var_cassetteqty.Invisible = false;
		Inputs.var_wedgepartnum.Invisible = false;
		Inputs.var_wedgeqty.Invisible = false;
		Inputs.var_webpartnum.Invisible = false;
		Inputs.var_webqty.Invisible = false;
		Inputs.var_tapeendpartnum.Invisible = false;
		Inputs.var_tapeendqty.Invisible = false;
	}

	/* String to indicate on Last Page that the cassette will come from a stocked part */

	if (Inputs.var_subcassstock.Value) {
		string subcassstring = "Cassette Sub-Assy: " + Inputs.dec_soqty.Value.ToString() + " x " + Inputs.var_casssmart.Value + " will be taken from available stock of " + availqtysub.ToString() + ".";
		Inputs.var_bomvalidity.Value = subcassstring;
		Inputs.var_casstkavail.Value = availqtysub;
		Inputs.var_bomvalidity.ToolTip = availqtysub.ToString();
	}

	if (!Inputs.var_subcassstock.Value) {
		Inputs.var_bomvalidity.Value = "Make Direct";
		Inputs.var_bomvalidity.ToolTip = "0";
	}

	/* ************************************************************************************************************************************************* */

	/* Validity Routines */

	/* Check that a FG Num has been passed */
 if ((Inputs.var_fgnum.Value == "") && (Inputs.chk_erroron.Value)) {

		MessageBox.Show("No Finished Goods number has been calculated for the chosen configuration. Please contact your Epicor Administrator to resolve this issue.", "Error", MessageBoxButtons.OK,  MessageBoxIcon.Exclamation);
		PageLeaveFunctions.SetNextInputPage(1);
		Args.Cancel = true;

 }

 /* Checks if FG Number passed to sales line is less than 50 Characters */
 decimal smartcount = 0;
 smartcount = Inputs.var_sku.Value.Length;
 if (smartcount > 50) {
	 Inputs.var_smart2.Value = Inputs.var_fgnum.Value + "+ XxChar_Count_ExceededxX";
	 Inputs.chk_makedirect.Value = true;
 }
 if (smartcount <= 50) {
	 Inputs.var_smart2.Value = Inputs.var_sku.Value;
 }

 /* Checks if fg description has been passed */
 string fgdesccheck = Inputs.var_fgdesc.Value;
 string fgdesc="";
if (fgdesccheck == "") {
	UDMethods.GetPartDescription(Context.CompanyID, Inputs.var_fgnum.Value, out fgdesc);
	if (fgdesc != "") {
		Inputs.var_fgdesc.Value = fgdesc;
		Inputs.var_fgvalidity.Value = "OK";
	}
	if ((fgdesc == "") && (Inputs.chk_erroron.Value)) {
		/* English */

		MessageBox.Show("No Description has been returned for the Finished Goods Number.", "Note", MessageBoxButtons.OK,  MessageBoxIcon.Information);
		PageLeaveFunctions.SetNextInputPage(1);
		Args.Cancel = true;

	}
}

/* ******************************************************************************************************************************************** */

/* Comment Lines */

/* Set Permissions */
string jobcommentamendpermission = "";
jobcommentamendpermission = PCLookUp.DataLookup("AutoGenComment_Control", "amend_permission", "JOB");
if (jobcommentamendpermission == "TRUE") {Inputs.chk_jobcomallow.Value = true;}
if (jobcommentamendpermission != "TRUE") {Inputs.chk_jobcomallow.Value = false;}

string salescommentamendpermission = "";
salescommentamendpermission = PCLookUp.DataLookup("AutoGenComment_Control", "amend_permission", "SALES");
if (salescommentamendpermission == "TRUE") {Inputs.chk_salescomallow.Value = true;}
if (salescommentamendpermission != "TRUE") {Inputs.chk_salescomallow.Value = false;}

string packcommentamendpermission = "";
packcommentamendpermission = PCLookUp.DataLookup("AutoGenComment_Control", "amend_permission", "PACK");
if (packcommentamendpermission == "TRUE") {Inputs.chk_packcomallow.Value = true;}
if (packcommentamendpermission != "TRUE") {Inputs.chk_packcomallow.Value = false;}

string boxcommentamendpermission = "";
boxcommentamendpermission = PCLookUp.DataLookup("AutoGenComment_Control", "amend_permission", "BOXLABEL");
if (boxcommentamendpermission == "TRUE") {Inputs.chk_boxcomallow.Value = true;}
if (boxcommentamendpermission != "TRUE") {Inputs.chk_boxcomallow.Value = false;}

/*  -------------------------------------------------------------------------------------------------------------------------------------- */

/* Fixing Kit */
string fixkitcomment="";
if (Inputs.cmb_fixingkit.Value != "") {fixkitcomment = " (Fixing - " + Inputs.cmb_fixingkit.Value + " )";}

if ((Inputs.cmb_direction.Value != "") && (Inputs.chk_customwebbing.Value)) {
  aislewidthcomment = " (Aisle Width specified as " + Inputs.dec_aislewidth.ToString() + " " + webuomcomment + ", direction " + Inputs.cmb_direction.Value + ").";
}

if ((Inputs.cmb_direction.Value != "") && (!Inputs.chk_customwebbing.Value)) {
  aislewidthcomment = ".";
}

if (Inputs.var_iscustomlength.Value == "TRUE") {
  webbinglength = Inputs.dec_customweblength.Value.ToString();
}
if (Inputs.var_iscustomlength.Value != "TRUE") {
  webbinglength = Inputs.cmb_webbinglength.Value;
}

if (Inputs.cmb_capfinish.Value == "") {endcapcomment = " finish (No Caps), ";}
if (Inputs.cmb_capfinish.Value == "No Caps") {endcapcomment = " finish (No Caps), ";}
if (Inputs.cmb_capfinish.Value != "") {endcapcomment = " finish with " + Inputs.cmb_capfinish.Value + " end caps. ";}

/* Comment to notify the customer that the webbing may bow at longer lengths */
string webbow = "";
if ((Inputs.var_fgnum.Value == "899") && (prodgroup != "WBR")) {
  webbow = "  ** Note  bowing of the webbing is normal at longer extension lengths **";
}

/* Removes the Cut and Stitch reference from the webbing part description */
string replacecutref = Inputs.var_webdesc.Value.Replace("cut", "+");
string revisedwebdesc = replacecutref.Entry(0,'+').ToLower().Trim();

/* Determine if comment strings will be displayed */

string jobshow = "";
string salesshow = "";
string boxshow = "";

/* Setting for Auto Generated Comment */
jobshow = PCLookUp.DataLookup("AutoGenComment_Control", "generate_auto", "JOB");
salesshow = PCLookUp.DataLookup("AutoGenComment_Control", "generate_auto", "SALES");
boxshow = PCLookUp.DataLookup("AutoGenComment_Control", "generate_auto", "BOXLABEL");

if (Inputs.var_orderdtlpart.Value != Inputs.var_sku.Value) {
  Inputs.chk_overridecomments.Value = false;
}

if (!Inputs.chk_overridecomments.Value) { /* Prevents Override if manually amended and page events occur */

  /* Blank out comments if dynamic BAQ is used */
  if (Inputs.chk_nocommentgen.Value) {
    Inputs.var_jobcomments.Value = "";
  }

  if ((jobshow == "TRUE") && (!Inputs.chk_nocommentgen.Value)) {

    /* A refers to Mini Wallmount type  */
    /* With Webbing */
    if ((Inputs.var_commentformat.Value == "A") && (!Inputs.chk_prewindoption.Value) && (!Inputs.chk_nowebunwound.Value) && (Inputs.chr_webbingtype.Value != "RCV")) {
      Inputs.var_jobcomments.Value = Inputs.var_fgdesc.Value + " in " + Inputs.cmb_bodyfinish.Value + " finish, " + Inputs.cmb_tapeendselection.Value + " tape end with " + webbinglength + " " + webuomcomment + " of " + Inputs.var_webpartnum.Value + " webbing. " + fixkitcomment + aislewidthcomment;
    }

    /* Without Webbing  & prewound */
    if ((Inputs.var_commentformat.Value == "A") && (Inputs.chk_prewindoption.Value) && (Inputs.chr_webbingtype.Value != "RCV")) {
      Inputs.var_jobcomments.Value = "++ PREWOUND ++ " + Inputs.var_fgdesc.Value + " in " + Inputs.cmb_bodyfinish.Value + " finish. " + fixkitcomment;
    }

    /* Without Webbing  & Not prewound */
    if ((Inputs.var_commentformat.Value == "A") && (Inputs.chk_nowebunwound.Value) && (Inputs.chr_webbingtype.Value != "RCV")) {
      Inputs.var_jobcomments.Value = "++ NOT PREWOUND ++ " + Inputs.var_fgdesc.Value + " in " + Inputs.cmb_bodyfinish.Value + " finish. " + fixkitcomment;
    }

    /* Receiver Cassette */
    if ((Inputs.var_commentformat.Value == "A") && (Inputs.chr_webbingtype.Value == "RCV")) {
      Inputs.var_jobcomments.Value = Inputs.var_fgdesc.Value + " in " + Inputs.cmb_bodyfinish.Value + " finish. " + fixkitcomment;
    }

    /* ---------------------------------------------------------------- */

    /* B refers to Midi/Maxi Wallmount types */
    /* With Webbing */
    if ((Inputs.var_commentformat.Value == "B") && (!Inputs.chk_prewindoption.Value) && (!Inputs.chk_nowebunwound.Value)) {
      Inputs.var_jobcomments.Value = Inputs.var_fgdesc.Value + " in " + Inputs.cmb_bodyfinish.Value + "" + endcapcomment  + Inputs.cmb_tapeendselection.Value + " tape end with " + webbinglength + " " + webuomcomment + " of " + Inputs.var_webpartnum.Value + " webbing. " + fixkitcomment + aislewidthcomment;
    }

    /* Without Webbing  & prewound */
    if ((Inputs.var_commentformat.Value == "B") && (Inputs.chk_prewindoption.Value)) {
      Inputs.var_jobcomments.Value = "";
    }

    /* Without Webbing  & Not prewound */
    if ((Inputs.var_commentformat.Value == "B") && (Inputs.chk_nowebunwound.Value)) {
      Inputs.var_jobcomments.Value = "";
    }
  }
}

if (!Inputs.chk_overridecomments.Value) { /* Prevents Override if manually amended and page events occur */

  /* Blank out comments if dynamic BAQ is used */
  if (Inputs.chk_nocommentgen.Value) {
   Inputs.var_linecomment.Value = "";
  }

  if ((salesshow == "TRUE") && (!Inputs.chk_nocommentgen.Value)) {
    /* A refers to Mini Wallmount type */
    /* With Webbing */
    if ((Inputs.var_commentformat.Value == "A") && (!Inputs.chk_prewindoption.Value) && !(Inputs.chk_nowebunwound.Value) && (Inputs.chr_webbingtype.Value != "RCV")) {
      Inputs.var_linecomment.Value = Inputs.var_fgdesc.Value + " in " + Inputs.cmb_bodyfinish.Value + " finish, " + Inputs.cmb_tapeendselection.Value + " tape end with " + webbinglength + " " + webuomcomment + " of " + revisedwebdesc + "." + fixkitcomment + webbow;
    }

    /* Without Webbing  & prewound */
    if ((Inputs.var_commentformat.Value == "A") && (Inputs.chk_prewindoption.Value) && (Inputs.chr_webbingtype.Value != "RCV")) {
      Inputs.var_linecomment.Value = "++ PREWOUND ++ " + Inputs.var_fgdesc.Value + " in " + Inputs.cmb_bodyfinish.Value + " finish. " + fixkitcomment;
    }

    /* Without Webbing  & Not prewound */
    if ((Inputs.var_commentformat.Value == "A") && (Inputs.chk_nowebunwound.Value) && (Inputs.chr_webbingtype.Value != "RCV")) {
      Inputs.var_linecomment.Value = "++ NOT PREWOUND ++ " + Inputs.var_fgdesc.Value + " in " + Inputs.cmb_bodyfinish.Value + " finish. " + fixkitcomment;
    }

    /* Receiver Cassette */
    if ((Inputs.var_commentformat.Value == "A") && (Inputs.chr_webbingtype.Value == "RCV")) {
      Inputs.var_linecomment.Value = Inputs.var_fgdesc.Value + " in " + Inputs.cmb_bodyfinish.Value + " finish. " + fixkitcomment;
    }

    /* ---------------------------------------------------------------- */

    /* B refers to Midi/Maxi Wallmount types */

    if ((Inputs.var_commentformat.Value == "B") && (!Inputs.chk_prewindoption.Value) && (!Inputs.chk_nowebunwound.Value)) {
      Inputs.var_linecomment.Value = Inputs.var_fgdesc.Value + " in " + Inputs.cmb_bodyfinish.Value + "" + endcapcomment + Inputs.cmb_tapeendselection.Value + " tape end with " + webbinglength + " " + webuomcomment + " of " + revisedwebdesc + "." + fixkitcomment + webbow;
    }

    /* Without Webbing  & prewound */
    if ((Inputs.var_commentformat.Value == "B") && (Inputs.chk_prewindoption.Value)) {
      Inputs.var_linecomment.Value = "";
    }

    /* Without Webbing  & Not prewound */
    if ((Inputs.var_commentformat.Value == "B") && (Inputs.chk_nowebunwound.Value)) {
      Inputs.var_linecomment.Value = "";
    }
  }
}

